,p_validation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'BEGIN',
'',
'    --check if the start or end date is null, if so the date range is valid',
'    IF (:EFF_START_DATE IS NULL OR :EFF_END_DATE IS NULL) THEN',
'        RETURN TRUE;',
'',
'    ELSIF (TO_DATE(:EFF_START_DATE) <= TO_DATE(:EFF_END_DATE)) THEN',
'        --check if the effective start date is before or the same as the effective end date',
'        RETURN TRUE;',
'',
'    ELSE',
'        --the start/end dates are defined and the start date occurs after the end date, the date values are invalid',
'        RETURN FALSE;',
'',
'    END IF;',
'',
'END;'))
