'		--delete the user and any associated DVM records',
'		AUTH_APP_DVM_PKG.DELETE_USER_SP (TO_NUMBER(:APP_USER_ID));',
'',
'	ELSIF :APEX$ROW_STATUS = ''C'' THEN',
'		--insert the new user record',
'',
'		INSERT INTO AUTH_APP_USERS (APP_USER_NAME, APP_USER_COMMENTS, APP_USER_ACTIVE_YN, APP_USER_FIRST_NAME, APP_USER_LAST_NAME) VALUES (:APP_USER_NAME, :APP_USER_COMMENTS, :APP_USER_ACTIVE_YN, :APP_USER_FIRST_NAME, :APP_USER_LAST_NAME) RETURNING APP_USE'
||'R_ID INTO :APP_USER_ID;',
'',
'	ELSIF :APEX$ROW_STATUS = ''U'' THEN',
'		--update the user record ',
'		UPDATE AUTH_APP_USERS SET APP_USER_NAME = :APP_USER_NAME, APP_USER_COMMENTS = :APP_USER_COMMENTS, APP_USER_ACTIVE_YN = :APP_USER_ACTIVE_YN, APP_USER_FIRST_NAME = :APP_USER_FIRST_NAME, APP_USER_LAST_NAME = :APP_USER_LAST_NAME WHERE APP_USER_ID = :AP'
||'P_USER_ID;',
'',
'	END IF;',
'',
'',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(296706687946666492)
,p_process_success_message=>'User(s) Updated<BR>'
,p_internal_uid=>291445109605448901
);
end;
