begin
wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(296719051673666514)
,p_process_sequence=>30
,p_process_point=>'AFTER_SUBMIT'
,p_region_id=>wwv_flow_imp.id(4010864276087243310)
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'User Groups - Save Interactive Grid Data'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'--user group IG processing:',
'begin',
'',
'--    DB_LOG_PKG.ADD_LOG_ENTRY (''DEBUG'', ''User Groups - Save Interactive Grid'', ''process user group (''||:APP_USER_GROUP_ID||'') for user (''||:APP_USER_ID||'')'');',
'',
'	if :APEX$ROW_STATUS = ''D'' THEN',
'		--delete the user group',
'		DELETE FROM AUTH_APP_USER_GROUPS WHERE APP_USER_GROUP_ID = :APP_USER_GROUP_ID;',
'',
'	ELSIF :APEX$ROW_STATUS = ''C'' THEN',
'		--insert the new user role record',
'',
'--        DB_LOG_PKG.ADD_LOG_ENTRY(''DEBUG'', ''User Groups - Save Interactive Grid'', ''insert the new user role record (''||:APP_USER_ID||'')'');',
'',
'		INSERT INTO AUTH_APP_USER_GROUPS (APP_USER_ID, APP_GROUP_ID, EFF_START_DATE, EFF_END_DATE) VALUES (:APP_USER_ID, :APP_GROUP_ID, TO_DATE(:EFF_START_DATE), TO_DATE(:EFF_END_DATE));',
'',
'',
'',
'	ELSIF :APEX$ROW_STATUS = ''U'' THEN',
'		--update the user record ',
'',
'--        DB_LOG_PKG.ADD_LOG_ENTRY(''DEBUG'', ''User Groups - Save Interactive Grid'', ''update the existing user role record (''||:APP_USER_ID||'')'');',
'',
'		UPDATE AUTH_APP_USER_GROUPS SET APP_USER_ID = :APP_USER_ID, APP_GROUP_ID = :APP_GROUP_ID, EFF_START_DATE = TO_DATE(:EFF_START_DATE), EFF_END_DATE = TO_DATE(:EFF_END_DATE) WHERE APP_USER_GROUP_ID = :APP_USER_GROUP_ID;',
'	END IF;',
'',
'    --check if the :P600_USER_IDS is blank',
'    IF (:P600_USER_IDS IS NULL) THEN',
'        --the :P600_USER_IDS is blank, set the value of :P600_USER_IDS to the current :APP_USER_ID value',
'        :P600_USER_IDS := :APP_USER_ID;',
'',
'    ELSE',
'        --the :P600_USER_IDS is not blank, append the value of the current :APP_USER_ID value to the :P600_USER_IDS application item',
'        :P600_USER_IDS := :P600_USER_IDS||'',''||:APP_USER_ID;',
'',
'    END IF;',
'',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(296706687946666492)
,p_process_success_message=>'User Permissions Updated<BR>'
,p_internal_uid=>291451373075448910
);
wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(296721209724666524)
,p_process_sequence=>40
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'User Groups - DVM execution on Interactive Grid Data'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare ',
'',
'    --variable to store the number of DVM active error records so the user can be notified',
'    v_num_DVM_recs PLS_INTEGER;',
'',
'',
'    v_username AUTH_APP_USERS.APP_USER_NAME%TYPE;',
'',
'',
'',
'BEGIN',
'',
'--    DB_LOG_PKG.ADD_LOG_ENTRY (''DEBUG'', ''User Groups - DVM Execution'', ''process users'');',
'',
'    --check if the P600_USER_IDS apex item value is blank',
'    IF (:P600_USER_IDS IS NOT NULL) THEN',
'        --the P600_USER_IDS apex item value is not blank, parse the numeric values and execute the DVM on each user record',
'',
'        --initialize the DVM_INFO_MSG apex item value',
'        :P600_DVM_INFO_MSG := NULL;',
'',
'',
'',
'    	--parse the unique list of APP_USER_IDS stored in the :P600_USER_IDS apex item and loop through them to process them:',
'        for records IN ',
'        (SELECT DISTINCT VALUE FROM ',
'            (with rws as (',
'              select :P600_USER_IDS str from dual',
'            )',
'              select regexp_substr (',
'                       str,',
'                       ''[^,]+'',',
'                       1,',
'                       level',
'                     ) value',
'              from   rws',
'              connect by level <= ',
'                length ( str ) - length ( replace ( str, '','' ) ) + 1))',
'        LOOP ',
'    		--process the current APP_USER_ID value',
'',
'--            DB_LOG_PKG.ADD_LOG_ENTRY (''DEBUG'', ''User Groups - DVM Execution'', ''process the current user: ''||records.VALUE);',
'',
'            --execute the DVM on the current APP_USER_ID value:',
'        	AUTH_APP_DVM_PKG.EXEC_DVM_USER_SP(TO_NUMBER(records.VALUE));',
'',
'            --retrieve the number of DVM active error records that are associated with the user who had a new user role created ',
'            SELECT (SELECT count(*) FROM AUTH_APP_USER_ISS_V where APP_USER_ID = records.VALUE AND ISS_SEVERITY_CODE = ''ERROR'' AND ISS_RES_TYPE_ID IS NULL), (SELECT APP_USER_NAME FROM AUTH_APP_USERS WHERE APP_USER_ID = records.VALUE) INTO v_num_DVM_r'
||'ecs, v_username FROM DUAL;',
'',
'            --check if there is more than one active DVM error associated with the current user',
'            IF (v_num_DVM_recs > 0) THEN',
'                --add a validation error for the user''s DVM error(s) to prevent the record update in the DB',
'    --            APEX_ERROR.ADD_ERROR (p_message          => ''(Save Operation Succeeded with Error) The user "''||v_username||''" has one or more invalid/overlapping user permission definitions'',',
'    --    p_display_location => apex_error.c_inline_in_notification);',
'',
'                --add the validation issue error notification',
'                IF (:P600_DVM_INFO_MSG IS NULL) THEN',
'                    :P600_DVM_INFO_MSG := ''"''||v_username||''"'';',
'                ELSE',
'                    :P600_DVM_INFO_MSG := :P600_DVM_INFO_MSG||'', "''||v_username||''"'';',
'                END IF;',
'            END IF;',
'',
'',
'',
'        END LOOP;',
'    	',
'        --check if there were any validation errors for users:',
'        IF (:P600_DVM_INFO_MSG IS NOT NULL) THEN',
'            :P600_DVM_INFO_MSG := ''(Validation Error(s)) Invalid/Overlapping user permissions for the following user(s): ''||:P600_DVM_INFO_MSG;',
'        END IF;',
'',
'    END IF;',
'',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(296706687946666492)
,p_process_success_message=>'&P600_DVM_INFO_MSG.'
,p_internal_uid=>291453531126448920
);
end;
