'							  WHEN DVM_ISSUES.ISS_RES_TYPE_ID IS NOT NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where dvm_ISS_types.ISS_type_id = DVM_ISSUES.ISS_typ'
||'e_id) = ''ERROR'' THEN ''Annotated Error''',
'							  WHEN DVM_ISSUES.ISS_RES_TYPE_ID IS NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where dvm_ISS_types.ISS_type_id = DVM_ISSUES.ISS_type_id'
||') = ''WARN'' THEN ''Active Warning''',
'							  WHEN DVM_ISSUES.ISS_RES_TYPE_ID IS NOT NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where dvm_ISS_types.ISS_type_id = DVM_ISSUES.ISS_typ'
||'e_id) = ''WARN'' THEN ''Annotated Warning''',
'							ELSE NULL END ISSUE_CATEGORY,',
'							(SELECT APP_USER_ID FROM AUTH_APP_USERS WHERE AUTH_APP_USERS.PTA_ISS_ID = DVM_ISSUES.PTA_ISS_ID) APP_USER_ID,',
