'							(SELECT CASE WHEN ISS_RES_TYPE_CODE IS NOT NULL THEN ''resolved-issue'' WHEN ISS_SEVERITY_CODE = ''ERROR'' THEN ''unresolved-error'' WHEN ISS_SEVERITY_CODE = ''WARN'' THEN ''unresolved-warning'' else NULL end FROM DVM_PTA_ISSUES_V where DVM_PTA_ISSUES_V'
||'.ISS_ID = DVM_ISSUES.ISS_id) row_class',
'',
'',
'',
'								   ',
'							  from DVM_ISSUES',
'							  WHERE ',
'								(:P610_ISSUE_CATEGORIES IS NULL ',
'									 OR (:P610_ISSUE_CATEGORIES = ''annotated_warning'' AND DVM_ISSUES.ISS_RES_TYPE_ID IS NOT NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id whe'
||'re dvm_ISS_types.ISS_type_id = DVM_ISSUES.ISS_type_id) = ''WARN'')',
'									 OR (:P610_ISSUE_CATEGORIES = ''active_warning'' AND DVM_ISSUES.ISS_RES_TYPE_ID IS NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where dvm_'
||'ISS_types.ISS_type_id = DVM_ISSUES.ISS_type_id) = ''WARN'')',
'									 OR (:P610_ISSUE_CATEGORIES = ''active_error'' AND DVM_ISSUES.ISS_RES_TYPE_ID IS NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where dvm_IS'
||'S_types.ISS_type_id = DVM_ISSUES.ISS_type_id) = ''ERROR'') ',
'									 OR (:P610_ISSUE_CATEGORIES = ''annotated_error'' AND DVM_ISSUES.ISS_RES_TYPE_ID IS NOT NULL AND (SELECT ISS_SEVERITY_CODE from dvm_ISS_severity inner join dvm_ISS_types on dvm_ISS_severity.ISS_severity_id = dvm_ISS_types.ISS_severity_id where'
||' dvm_ISS_types.ISS_type_id = DVM_ISSUES.ISS_type_id) = ''ERROR''))'))
,p_plug_source_type=>'NATIVE_IG'
,p_prn_page_header=>'User Validation Issues'
,p_plug_header=>'<B>**Note:</B> Resolved validation errors and warnings (Issue Resolution was defined) are shown in light green and have an alternate text of "This cruise issue has been resolved (Issue Resolution was defined)" and unresolved validation errors (Issue '
